@Override
  public void prependTo(@NotNull final RawSqlBuilder builder) {
    builder.prepend(')');

    for (int i = mExpressions.length - 1; i >= 0; i--) {
      builder.prepend('?');
      if (i > 0) {
        builder.prepend(",");
      }
    }

    builder.prepend("VALUES (");
  }
